import { Stack } from '@mui/material';
import { Images } from '../Constants/images';

const Home = () => {
  const Styles = {
    backgroundImage: `url(${Images.BG})`,
    backgroundSize: 'cover',
    backgroundRepeat: 'no-repeat',
    height: '100%',
    width: '100%',
  };

  return (
    <section className='h-screen w-screen'>
      <div style={Styles}>
        <Stack>
          
        </Stack>
      </div>
    </section>
  );
};

export default Home;
